import {createMuiTheme} from '@material-ui/core';

const theme = createMuiTheme({ palette: {
    primary: {
      main: '#556cd6',
    },
    secondary: {
      main: '#19857b',
    },
    error: {
      main: 'r',
    },
    background: {
      default: '#fff',
    },
  },});

export default theme;
